package collection;

import java.util.HashSet;
import java.util.Set;

public class SetRemove {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		 Set<String>obj=new HashSet<String>();
		    obj.add("Black");
		    obj.add("Red");
		    obj.add("Pink");
		    obj.add("Yellow");
		    obj.remove("Red");
		    System.out.println(obj);
		    
		    
	}

}
